INSERT INTO `comment` VALUES (71,'麻辣鸡丝凉面真是好吃.和去成都旅游的时候吃到的一样,味道很赞','5a54ece8c10d7.6442182.jpg','2018-01-09 16:25:12',NULL,19,'151551503644219470'),(72,'自从有了表食堂,早餐再也不喝咖啡了,这个鸡蛋非常有能量,油条也非常好,地道的中国味,就是8元的配送费有点贵了,不过想想,能从中国送到德国,鸡蛋还一点也没碎,到手里还是热乎的,8元也不算太贵.期待表食堂赶快出新品.','','2018-01-09 16:27:32',NULL,19,'15155143991260851');
